import React, { useState } from 'react';

function Navbar() {

  const [navbarOpen, setNavbarOpen] = useState(false);

  const toggleHandle = () => {
    setNavbarOpen(prev => !prev)
  }

  return (
    <nav className="navBar">
      <button onClick={toggleHandle}>{navbarOpen ? "Close" : "Open"}</button>
      <ul>...</ul>
    </nav>
  )
}

export default Navbar;
